</div>
<div class="col-lg-4">
<h1>دمنهور</h1>
<p>تحليل المخدرات: معامل البرج <br /> <a href="https://goo.gl/maps/R4SeAWg8zRk">الموقع<img src="../img/place.png" /></a><br /> مركز 3 s بجوار موقف دمنهور خلف مدرسة المنارة <br /> &bull; 25 جنية لموديلات عام 2018-2019 cars <br /> &bull; 70 جنية لموديلات عام 2017 cars <br /> &bull; 85 جنية لموديلات عام 2016 cars and beyond <br /> <a href="https://goo.gl/maps/f8vFKzTS99M2">الموقع<img src="../img/place.png" /></a></p>
</div>
<div class="col-lg-4">
<h1>الغردقة</h1>
